DROP TABLE IF EXISTS "Account";
CREATE TABLE "Account" ("ID" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , "Username" CHAR UNIQUE , "Name" CHAR, "Password" INTEGER, "Sec_Q" CHAR, "Answer" CHAR);
DROP TABLE IF EXISTS "Book";
CREATE TABLE "Book" ("ID" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , "Name" CHAR, "Edition" INTEGER, "ISBN" INTEGER UNIQUE , "Publisher" CHAR, "Price" INTEGER, "Pages" INTEGER);
DROP TABLE IF EXISTS "Issue";
CREATE TABLE "Issue" ("ID" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , "Book_ISBN" INTEGER , "Name" CHAR, "Edition" INTEGER, "Publisher" CHAR, "Price" INTEGER, "Pages" INTEGER, "Student_ID" INTEGER, "SName" CHAR, "FName" CHAR, "Course" CHAR, "Branch" CHAR, "Year" INTEGER, "Semester" INTEGER, "DateOfIssue" INTEGER);
DROP TABLE IF EXISTS "Return";
CREATE TABLE "Return" ("ID" INTEGER PRIMARY KEY  NOT NULL ,"Student_ID" INTEGER,"Name" CHAR,"FName" CHAR,"Course" CHAR,"Branch" CHAR,"Year" INTEGER,"Semester" INTEGER,"Book_ISBN" INTEGER DEFAULT (null) ,"BName" CHAR,"Edition" INTEGER,"Publisher" CHAR,"Price" INTEGER,"Pages" INTEGER,"DOI" INTEGER,"DOR" INTEGER);
DROP TABLE IF EXISTS "Student";
CREATE TABLE "Student" ("ID" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , "Student_ID" INTEGER UNIQUE , "Name" CHAR, "Father" CHAR, "Course" CHAR, "Branch" CHAR, "Year" INTEGER, "Semester" INTEGER, "Image" BLOB);
